[[package]]
name = "astroid"
version = "2.11.3"
description = "An abstract syntax tree for Python with inference support."
category = "dev"
optional = false
python-versions = ">=3.6.2"

[package.dependencies]
lazy-object-proxy = ">=1.4.0"
typing-extensions = {version = ">=3.10", markers = "python_version < \"3.10\""}
wrapt = ">=1.11,<2"

[[package]]
name = "colorama"
version = "0.4.4"
description = "Cross-platform colored terminal text."
category = "dev"
optional = false
python-versions = ">=2.7, !=3.0.*, !=3.1.*, !=3.2.*, !=3.3.*, !=3.4.*"

[[package]]
name = "dill"
version = "0.3.4"
description = "serialize all of python"
category = "dev"
optional = false
python-versions = ">=2.7, !=3.0.*"

[package.extras]
graph = ["objgraph (>=1.7.2)"]

[[package]]
name = "isort"
version = "5.10.1"
description = "A Python utility / library to sort Python imports."
category = "dev"
optional = false
python-versions = ">=3.6.1,<4.0"

[package.extras]
pipfile_deprecated_finder = ["pipreqs", "requirementslib"]
requirements_deprecated_finder = ["pipreqs", "pip-api"]
colors = ["colorama (>=0.4.3,<0.5.0)"]
plugins = ["setuptools"]

[[package]]
name = "lazy-object-proxy"
version = "1.7.1"
description = "A fast and thorough lazy object proxy."
category = "dev"
optional = false
python-versions = ">=3.6"

[[package]]
name = "mccabe"
version = "0.7.0"
description = "McCabe checker, plugin for flake8"
category = "dev"
optional = false
python-versions = ">=3.6"

[[package]]
name = "mouseinfo"
version = "0.1.3"
description = "An application to display XY position and RGB color information for the pixel currently under the mouse. Works on Python 2 and 3."
category = "main"
optional = false
python-versions = "*"

[package.dependencies]
pyperclip = "*"
python3-Xlib = {version = "*", markers = "platform_system == \"Linux\" and python_version >= \"3.0\""}
rubicon-objc = {version = "*", markers = "platform_system == \"Darwin\""}

[[package]]
name = "platformdirs"
version = "2.5.2"
description = "A small Python module for determining appropriate platform-specific dirs, e.g. a \"user data dir\"."
category = "dev"
optional = false
python-versions = ">=3.7"

[package.extras]
docs = ["furo (>=2021.7.5b38)", "proselint (>=0.10.2)", "sphinx-autodoc-typehints (>=1.12)", "sphinx (>=4)"]
test = ["appdirs (==1.4.4)", "pytest-cov (>=2.7)", "pytest-mock (>=3.6)", "pytest (>=6)"]

[[package]]
name = "pyautogui"
version = "0.9.53"
description = "PyAutoGUI lets Python control the mouse and keyboard, and other GUI automation tasks. For Windows, macOS, and Linux, on Python 3 and 2."
category = "main"
optional = false
python-versions = "*"

[package.dependencies]
mouseinfo = "*"
pygetwindow = ">=0.0.5"
pymsgbox = "*"
pyobjc = {version = "*", markers = "platform_system == \"Darwin\""}
pyobjc-core = {version = "*", markers = "platform_system == \"Darwin\""}
pyscreeze = ">=0.1.21"
python3-Xlib = {version = "*", markers = "platform_system == \"Linux\" and python_version >= \"3.0\""}
PyTweening = ">=1.0.1"

[[package]]
name = "pygetwindow"
version = "0.0.9"
description = "A simple, cross-platform module for obtaining GUI information on application's windows."
category = "main"
optional = false
python-versions = "*"

[package.dependencies]
pyrect = "*"

[[package]]
name = "pylint"
version = "2.13.7"
description = "python code static checker"
category = "dev"
optional = false
python-versions = ">=3.6.2"

[package.dependencies]
astroid = ">=2.11.3,<=2.12.0-dev0"
colorama = {version = "*", markers = "sys_platform == \"win32\""}
dill = ">=0.2"
isort = ">=4.2.5,<6"
mccabe = ">=0.6,<0.8"
platformdirs = ">=2.2.0"
tomli = {version = ">=1.1.0", markers = "python_version < \"3.11\""}
typing-extensions = {version = ">=3.10.0", markers = "python_version < \"3.10\""}

[package.extras]
testutil = ["gitpython (>3)"]

[[package]]
name = "pymsgbox"
version = "1.0.9"
description = "A simple, cross-platform, pure Python module for JavaScript-like message boxes."
category = "main"
optional = false
python-versions = "*"

